import React from 'react';

function User({ user }) {
    return (
        <div>
            <b>{user.username}</b> <span>({user.email})</span>
        </div>
    );
}

function UserList() {
    const users = [
        {
            id: 1,
            username: 'bokjiho',
            email: 'bok.jiho@gmail.com',
        },
        {
            id: 2,
            username: 'jiminbok',
            email: 'jiminbok@gmail.com',
        },
        {
            id: 3,
            username: 'ockmilee',
            email: 'leeockmi121@gmail.com',
        },
    ];

    return (
        <div>
            {users.map(user => (
                <User user={user} key={user.id} />
            ))}
        </div>
    );
}

export default UserList;
